import React, { Fragment } from 'react'
import { Form, FormGroup,Input, FormText, Button } from 'reactstrap';

const AddCourse=()=>{

    return (
     <Fragment>
      <h1 className="">Fill Course Details</h1>
      <Form>
        <FormGroup>
          <label for="userId">Course Id</label>
          <Input type="text" placeholder="Enter Here" name="userId" id="userId"></Input>
          <label for="userName">Course Name</label>
          <Input type="text" placeholder="Enter Here" name="userName" id="userName"></Input>
       
        </FormGroup>
      </Form>
     </Fragment>
    );
}

export default AddCourse;
